      SELECT + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( - - col1, 73, - col0 * + col1, + 4 );
  - name: tab2

outputs:
  - name: q2384.out
    data: |
      46
      64
      75
